from typing import Dict, Any

def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """
    Merge multiple dictionaries.

    Later dictionaries override earlier ones on key conflicts.
    Handles None values gracefully.

    Args:
        *dicts: Variable number of dictionaries to merge.

    Returns:
        A new dictionary with all keys from input dictionaries.

    Raises:
        TypeError: If any argument is not a dictionary or None.
        ValueError: If no dictionaries are provided.

    Examples:
        >>> merge_dicts({"a": 1}, {"b": 2})
        {"a": 1, "b": 2}
        >>> merge_dicts({"a": 1}, {"a": 2})
        {"a": 2}
    """
    if not dicts:
        raise ValueError("At least one dictionary must be provided")

    result: Dict[str, Any] = {}

    for d in dicts:
        if d is None:
            continue

        if not isinstance(d, dict):
            raise TypeError(f"Expected dict or None, got {type(d).__name__}")

        result.update(d)

    return result


